const userPage = () => {
    const router = useRouter();
    const { username } = router.query;

    return (
        <div>
            <h1>User Profile:</h1>
        </div>
    )
}

class Page extends React.Component {

    componentDidMount(){
        console.log(this.props.query);
    }

    render() {
        const router = useRouter();
        const { username } = router.query;

        return (
            <div>
                <h1>user</h1>
                <hr/>
                <h2>{this.username}</h2>
            </div>  
        )
    }
};

export default Page
